import React from 'react';
import ReactDOM from 'react-dom/client';


function App() {
    return (<div className='Main'>
            <Header/>
            <Container/>
            <Footer/>
        </div>
    )
}

const app = ReactDOM.createRoot(document.getElementById('App'))

function Header() {
    return (<h1>Шапка</h1>)
}

function Container() {
    return (<h1>Контейнер</h1>)
}

function Footer() {
    return (<h1>Подвал</h1>)
}

app.render(<App/>)
